import React from 'react'

const LogoutButton = ({dispatch}) => {
    const logout = () => {
        localStorage.removeItem('token')
        dispatch({
            type: "LOGOUT"
        })
    }
    return(
        <button onClick={logout}>logout</button>
    )
}

export {
    LogoutButton
}
